import React from 'react';
import { 
  Nav, 
  NavbarContainer, 
  NavLogo, 
  MobileIcon, 
  NavItem, 
  NavMenu, 
  NavLinks 
} from './NavbarElements';
import { FaBars } from 'react-icons/fa'

const Navbar = ()=> {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to='/'>DKL</NavLogo>
          <MobileIcon>
            <Fabars />
          </MobileIcon>
          <NavItem>
            <NavLinks to='about'>About</NavLinks>
          </NavItem>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar
